          }}
          id="controllable-states-demo"
          options={heroes}
          style={{ width: "70%", padding: "10px", background: "#FFF", borderColor: "#FFF" }}
          renderInput={
            (params) =>
              <TextField
                style={{ background: "#000", borderColor: "#FFF" }} {...params}
                label="Escolha um super heroi"
                variant="outlined"
                InputLabelProps={{
                  style: {
                    color: "#6495ed"
                  }
                }}
                InputProps={{
                  style: {
                    borderBottom: "1px #6495ed solid",
                    color: "#6495ed"
                  }
                }}
              />
          }
        /> */}

        <div>
          <div>{`value: ${value !== null ? `'${value}'` : "null"}`}</div>
          <div>{`inputValue: '${inputValue}'`}</div>
          <br />
          <Autocomplete
            value={value}
            onChange={(event, newValue) => {
              setValue(newValue);
            }}
            inputValue={inputValue}
            onInputChange={(event, newInputValue) => {
              setInputValue(newInputValue);
            }}
            id="controllable-states-demo"
            options={options}
            style={{ width: 300 }}
            renderInput={params => (
              <TextField {...params} label="Controllable" variant="outlined" />
            )}
          />
        </div>
      </Container>
    </>
  );
};

export default Home;
